import React from "react";
import "../styles/SafetyTips.css";

function SafetyTips() {
  return (
    <div className="safety-container">
      <h2>Safety Tips</h2>
      <p>1. Always share your live location with a trusted contact.</p>
      <p>2. Avoid unknown areas late at night.</p>
      <p>3. Keep emergency contacts saved in your phone.</p>
    </div>
  );
}

export default SafetyTips;
